import React from 'react';
//import { Form, Button, Col, Row } from 'react-bootstrap';
import { connect } from 'react-redux';
import { ticketDetails } from "./../Stitch/mongodb";
//import './../CSS/bookingrequests.css';

class Tickets extends React.Component {

    constructor(props) {
       super(props)
       this.state = {
            tickets: []
       }
    }

    async componentDidMount() {
        //var curruser = this.props.reducerState.userReducer.currentuser;
        var Tickets = await ticketDetails.find({}).toArray();
        Tickets.forEach(element => {
            this.setState(...this.state.tickets, {tickets: element});
        console.log("Tickets:- " + Tickets[0].start);
    });
}

    render() {
        console.log(this.state.tickets);
        var ticketList = this.state.tickets.map( (details) => {
            return(
            <tr key={details.cus_id}>
                <td>details.start</td>
                <td>details.destiny</td>
                <td>details.startdate</td>
                <td>details.returndate</td>
                <td>details.quantity</td>
            </tr>)
        } );

        return (
            <div>
                <h1>Your Tickets</h1>

                {/* <table>
                    <thead>
                        <tr>
                            <th>Start</th>
                            <th>Destiny</th>
                            <th>Start Date</th>
                            <th>Return Date</th>
                            <th>Quantity</th>
                            
                        </tr>
                    </thead>
                    <tbody>
                        {ticketList}
                    </tbody>
                </table> */}
            </div>
            );
    }
}


const mapStateToProps = (state) => ({
    reducerState: state
})


export default connect(mapStateToProps)(Tickets);
